import React from 'react';

const ItemsDetail = props => {
    const { name, amount, imageUrl } = props.item

    return (
        <li className="media">
            <div className="media-left">
                <img
                    className="media-object img-circle"
                    width="100px"
                    src={imageUrl}
                    alt={name}
                />
            </div>
            <div className="media-body">
                <h4 className="media-heading">{name}</h4>
                <hr />
                <p>
                    <b>Amount: </b>
                    {amount}
                </p>
            </div>
        </li>
    );
};

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                    1
                </p>
            </header>
        </div>
    );
};

export default Item;
